(20, 'payout_confirmation_document_send', 'Ihre Auszahlungsbestätigung & Rechnung – {invoice_no}', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n  <meta charset=\"utf-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n  <title>Auszahlungsbestätigung & Rechnung – TradeVest Crypto</title>\r\n  <style>\r\n    body {\r\n      font-family: Arial, sans-serif;\r\n      line-height: 1.6;\r\n      color: #333;\r\n      background: #f4f6f8;\r\n      margin: 0;\r\n      padding: 0;\r\n    }\r\n\r\n    .container {\r\n      max-width: 640px;\r\n      margin: 30px auto;\r\n      background: #fff;\r\n      border-radius: 10px;\r\n      box-shadow: 0 4px 16px rgba(0,0,0,0.08);\r\n      overflow: hidden;\r\n    }\r\n\r\n    .header {\r\n      background: linear-gradient(90deg, #2950a8 0%, #2da9e3 100%);\r\n      color: #fff;\r\n      text-align: center;\r\n      padding: 30px 20px;\r\n    }\r\n\r\n    .header h1 {\r\n      margin: 0;\r\n      font-size: 26px;\r\n      font-weight: 600;\r\n    }\r\n\r\n    .header p {\r\n      margin-top: 8px;\r\n      font-size: 15px;\r\n      opacity: 0.9;\r\n    }\r\n\r\n    .content {\r\n      padding: 25px;\r\n      background: #f9f9f9;\r\n    }\r\n\r\n    table.details {\r\n      width: 100%;\r\n      border-collapse: collapse;\r\n      margin-top: 15px;\r\n      background: #fff;\r\n      border-radius: 6px;\r\n      overflow: hidden;\r\n      box-shadow: 0 2px 8px rgba(0,0,0,0.03);\r\n    }\r\n\r\n    table.details td {\r\n      padding: 10px 12px;\r\n      border-bottom: 1px solid #eee;\r\n      font-size: 14px;\r\n    }\r\n\r\n    table.details tr:last-child td {\r\n      border-bottom: none;\r\n    }\r\n\r\n    table.details td:first-child {\r\n      color: #555;\r\n      width: 50%;\r\n    }\r\n\r\n    table.details td:last-child {\r\n      text-align: right;\r\n      font-weight: bold;\r\n      color: #111;\r\n    }\r\n\r\n    .highlight-box {\r\n      background: linear-gradient(90deg, #007bff10 0%, #007b