rvicegebühr:</td>\r\n          <td>{service_fee} €</td>\r\n        </tr>\r\n      </table>\r\n\r\n      <div class=\"highlight-box\">\r\n        <p>\r\n          💡 Bitte beachten Sie, dass der ausgewiesene Betrag je nach Bank  \r\n          innerhalb von 1–3 Werktagen auf Ihrem Konto eingehen kann.\r\n        </p>\r\n      </div>\r\n\r\n      <p>\r\n        Falls Sie Rückfragen zu dieser Auszahlung oder Rechnung haben,  \r\n        steht Ihnen unser Support-Team gerne zur Verfügung.\r\n      </p>\r\n\r\n      <p>Mit freundlichen Grüßen,</p>\r\n\r\n      <div class=\"signature\">\r\n        <img src=\"https://tradevestcrypto.de/assets/img/logo.png\" alt=\"TradeVest Crypto Logo\"><br>\r\n        <strong>TradeVest Crypto – Finanzabteilung</strong><br>\r\n        Gmundberg 6, 83471 Berchtesgaden, Deutschland<br>\r\n        E: <a href=\"mailto:info@tradevestcrypto.de\">info@tradevestcrypto.de</a> | \r\n        W: <a href=\"https://tradevestcrypto.de\">tradevestcrypto.de</a>\r\n        <p>\r\n          Sitz der Gesellschaft: Berchtesgaden – Registergericht: Traunstein – HRB: 10162132<br>\r\n          USt-IdNr.: DE 343 826 946 – Vertreten durch: Mark Senger und Natalie Stenzel<br>\r\n          <em>Hinweis:</em> Diese E-Mail kann vertrauliche oder rechtlich geschützte Informationen enthalten.  \r\n          Wenn Sie nicht der richtige Adressat sind, informieren Sie uns bitte und löschen Sie diese Nachricht.\r\n        </p>\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"footer\">\r\n      © 2025 TradeVest Crypto. Alle Rechte vorbehalten.\r\n    </div>\r\n  </div>\r\n</body>\r\n</html>\r\n', '[\"full_name\", \"invoice_no\", \"invoice_date\", \"lost_amount\", \"service_fee\", \"brand_name\",\"site_url\"]', '2025-09-10 03:45:40'),
(21, 'welcome_email', 'Herzlich willkommen bei {sbrand}!', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n    <meta charset=\"utf-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <title>Welcome to {sbrand}</title>\r\n    <style>\r\n        body { font-family: Arial, sans-serif; line-height: 1.6; color: #333; background: #f8f9fa; margin: 0; padding: 0; }\r\n        .container { max-width: 600px; margin: 30px auto; background: #fff; border-radius: 10px; box-shadow: 0 3px 10px rgba(0,0,0,0.1); overflow: hidden; }\r\n        .header { background: linear-gradient(90deg, #2950a8 0%, #2da9e3 100%); color: white; text-align: center; padding: 30px 20px; }\r\n        .header h1 { margin: 0; font-size: 24px; }\r\n        .content { padding: 25px; background: #f9f9f9; }\r\n        .details { background: #fff; padding: 20px; border-left: 4px solid #007bff; border-radius: 6px; margin: 20px 0; }\r\n        .btn { display: inline-block; background: #007bff; color: white; padding: 10px 18px; border-radius: 5px; text-decoration: none; font-weight: bold; }\r\n        .footer { text-align: center; font-size: 12px; color: #666; padding: 20px; background: #f1f1f1; }\r\n        .highlight { color: #007bff; font-weight: bold; }\r\n        .signature { margin-top: 30px; border-top: 1px solid #e0e0e0; padding-top: 20px; font-size: 14px; color: #555; }\r\n        .signature img { height: 45px; margin-bottom: 10px; }\r\n        .signature p { margin: 4px 0; }\r\n        @media only screen and (max-width: 600px) {\r\n            .container { width: 95%; }\r\n            .content { padding: 15px; }\r\n        }\r\n    </style>\r\n</head>\r\n<body>\r\n    <div class=\"container\">\r\n        <div class=\"header\">\r\n            <h1>Willkommen bei {sbrand}</h1>\r\n            <p>Ihr Zugang ist erfolgreich eingerichtet!</p>\r\n        </div>\r\n\r\n        <div class=\"content\">\r\n            <p>Sehr geehrte/r {last_name},</p>\r\n            <p>Herzlich will