en. Wenn Sie nicht der richtige Adressat sind, informieren Sie uns bitte und löschen Sie diese Nachricht.\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</body>\r\n</html>', '[\"last_name\",\"email\",\"pass\",\"sbrand\",\"surl\",\"semail\"]', '2025-10-29 23:57:17'),
